import React, { Component } from 'react'

export default class Cart extends Component {
    render() {
        const {cartItems}=this.props;
        return (

            <div>
                {cartItems.length=0? <div>Card empty</div>
                :
                <div>{cartItems.length} in the cart</div>
                }
            </div>
        )
    }
}
